import React, { useEffect, useState } from 'react';
import axios from 'axios';

const DataGrid = () => {

    const [todos, setTodos] = useState([])

    useEffect(()=>{
        axios.get("http://127.0.0.1:8000/todo/todo_info/")
        .then((res) => res.json())
        .then((res) => setTodos(res))
    },[])

    console.log(todos)

    return (
        <div>

        </div>
    )
}

export default DataGrid
